@LeLiveToussaint 
après l'itw du pr Raoult vous rapportez les infos gouv affirmant que 80% des reas en France sont des non vaccinés. Vous avez raison, Véran a obtenu des cuvées spéciales de vaccin parce que dans les autres pays c'est pas le cas:
https://t.co/GPTMo5UNEw

